// @material-ui/icons
import Dashboard from "@material-ui/icons/Dashboard";
import Group from "@material-ui/icons/Group";
// core components/views
import DashboardPage from "views/Dashboard/Sections/Dashboard.jsx";
import ClubProfile from "views/Dashboard/Sections/Profile.jsx";
import EventList from "views/Dashboard/Sections/EventList.jsx";
import AddEvent from "views/Dashboard/Sections/AddEvent.jsx";

const dashboardRoutesClub = [
  /*{
    path: "/dash/dashboard",
    sidebarName: "Dashboard",
    navbarName: "Material Dashboard",
    icon: Dashboard,
    component: DashboardPage
  },*/
  {
    path: "/dash/profile",
    sidebarName: "Club Info",
    navbarName: "Info",
    icon: Group,
    component: ClubProfile
  },
  {
    path: "/dash/myevents",
    sidebarName: "Mes events",
    navbarName: "Mes events",
    icon: Dashboard,
    component: EventList
  },
  { redirect: true, path: "/", to: "/", navbarName: "Redirect" }
];

export default dashboardRoutesClub;
